import React from 'react';

import Logo from './Logo';
import Menu from './Menu';

class Header extends React.Component {
    render() {
        return (
            <div className="header">
                <div className="header_components">
                    <Logo />
                    <Menu />
                </div>
            </div>
        );
    }
}

export default Header;
